import BrandContainer from '../BrandContainer/BrandContainer';
import styles from './BrandingContainer.module.css';

const BrandingContainer = () => {
    return (
        <div className={styles.content}>
            <div className={styles.item}>
                <BrandContainer brandingText="Branding" brandingImageUrl="/icon1.svg" />
                <BrandContainer brandingText="UX/UI Design" brandingImageUrl="/icon2.svg" />
            </div>
            <div className={styles.text}>Websites and branding that set the groundwork for successful marketing</div>
            <div className={styles.text1}>
                We create human-centered enterprise software that has the polished, snappy feel of the best consumer
                apps.
            </div>
        </div>
    );
};

export default BrandingContainer;
